import { Outlet } from "react-router-dom";
import Card from "../components/Card";
import MainNavigation from "../components/MainNavigation";

export default function RootLayoutPage() {
  return (
    <>
      <MainNavigation />
      <Card>
        <h1>RootLayoutPage</h1>
        <Outlet />
      </Card>
    </>
  );
}
